    symptom_map = {}

    def preprocess():
        diseases_list = []
        diseases_symptoms = []
        diseases = open('/home/TheHealthDome/symptoms/Resources/Diseases.txt')
        diseases_t = diseases.read()
        diseases_list = diseases_t.split("\n")
        diseases.close()
        for disease in diseases_list:
            disease_s_file = open('/home/TheHealthDome/symptoms/Resources/Disease Symptoms/' + str(disease) + '.txt')
            disease_s_data = disease_s_file.read()
            s_list = disease_s_data.split("\n")
            diseases_symptoms.append(s_list)
            symptom_map[str(s_list)] = disease
            disease_s_file.close()

    def accept_input(input_array):
        symptoms = open('/home/TheHealthDome/symptoms/Resources/Symptoms.txt')
        length = len(symptoms.readlines())
        if len(input_array) == length:
            return input_array

    def update_ans(no, name, last=0):
        if no == 1:
            answer = str(name)
            ans = open('/home/TheHealthDome/symptoms/Resources/results.txt', 'w')
            ans.write(answer+'\n')
            ans.close()
        else:
            if last == 1:
                answer = str(name)
                ans = open('/home/TheHealthDome/symptoms/Resources/results.txt', 'a')
                ans.write(answer+'\n')
                ans.close()
            else:
                answer = str(name)
                ans = open('/home/TheHealthDome/symptoms/Resources/results.txt', 'a')
                ans.write(answer+'\n')
                ans.close()

